**Describe the bug**
The performance of onednn is worse than the common version. The latency of common onnx is 120.066ms and the latency of onednn version is 172.544 ms.




**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): CentOS Linux release 7.9.2009 (Core)
- ONNX Runtime installed from (source or binary): common version is from binary, and onednn version is from source
- ONNX Runtime version: onnxruntime-linux-x64-1.11.1
- Python version: Python 3.9.7
- Visual Studio version (if applicable): None
- GCC/Compiler version (if compiling from source):  gcc version 9.3.1 20200408 (Red Hat 9.3.1-2) (GCC)
- CUDA/cuDNN version: None
- GPU model and memory: None

**To Reproduce**
- Describe steps/code to reproduce the behavior.
```
#include <assert.h>
#include <vector>
#include <sys/time.h>
#include <time.h>
#include <iostream>
#include <unistd.h>
#include "onnxruntime/core/session/onnxruntime_cxx_api.h"
#include "onnxruntime/core/providers/dnnl/dnnl_provider_factory.h"
using namespace std;
double time_get_ms() {
    struct timeval tv;
    double ret;
    int err;
    err = gettimeofday(&tv, 0);
    if (err == 0) {
        ret = tv.tv_sec * 1000.0 + tv.tv_usec * 1.0 / 1000;
        if (ret != ret) {
            ret = 0;
        }
    } else {
        ret = 0;
    }
    return ret;
}
int main(int argc, char* argv[]) {
    Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "test");
    Ort::SessionOptions session_options;
    session_options.SetIntraOpNumThreads(1);
    session_options.SetInterOpNumThreads(1);
    session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);

    // set use dnnl provider here 
    OrtSessionOptionsAppendExecutionProvider_Dnnl(session_options, 1);
    const char* model_path = argv[1];
    if (argc != 2) {
        cout << "invalid usage : " << argv[0] << " #model path#" << endl;
        return -1;
    }
    Ort::Session session(env, model_path, session_options);
    // print model input layer (node names, types, shape etc.)
    Ort::AllocatorWithDefaultOptions allocator;

    // print number of model input nodes
    size_t num_inputs = session.GetInputCount();
    size_t num_outputs = session.GetOutputCount();

    //get input names and output names
    std::vector<char*> input_node_names;
    for (size_t i = 0; i < num_inputs; i++) {
        input_node_names.push_back(session.GetInputName(i, allocator));
    }
    std::vector<char*> output_node_names;
    for (size_t i = 0; i < num_outputs; i++) {
        output_node_names.push_back(session.GetOutputName(i, allocator));
    }
    cout<<"input_number: "<<num_inputs<<endl;
    cout<<"output_number: "<<num_outputs<<endl;

    for(auto &it : input_node_names) {
        cout << "input name : " << it << endl;
    }
    for(auto &it : output_node_names) {
        cout << "output name : " << it << endl;
    }
    auto shape = session.GetInputTypeInfo(0).GetTensorTypeAndShapeInfo().GetShape();
    for (auto &it : shape) {
        cout << "shape : " << it << endl;
    }
    //create Ort::Value for onnxruntime inputs
    std::vector<int64_t> inputs_dims = {1, 3, 224, 224};
    size_t inputs_size = 1 * 3 * 224 * 224;
    std::vector<float> inputs_values(inputs_size, 1);
    auto memory_info_inputs = Ort::MemoryInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
    Ort::Value inputs_tensor = Ort::Value::CreateTensor<float>(memory_info_inputs, inputs_values.data(), inputs_size, inputs_dims.data(), 4);
    assert(inputs_tensor.IsTensor());
    std::vector<Ort::Value> ort_inputs;
    ort_inputs.push_back(std::move(inputs_tensor));
    int loop = 10;
    double b = 0;
    double e = 0;
    double d = 0;
    double total_duration = 0;
    double avg_duration = 0;
    for (int i = 0; i < loop; i++) {
        b = time_get_ms();
        session.Run(Ort::RunOptions{nullptr}, input_node_names.data(), ort_inputs.data(), ort_inputs.size(), output_node_names.data(), 1);
        e = time_get_ms();
        d = e - b;
        cout << "output_node_names size : " << output_node_names.size() << ", NO. " << i << ", forward duration : " << d << endl;
        total_duration += d;
    }
    avg_duration = total_duration / loop;
    cout << "AVG forward time : " << avg_duration << endl;
    printf("Done!\n");
    return 0;
}
```
- Attach the ONNX model to the issue (where applicable) to expedite investigation.
https://github.com/onnx/models/blob/main/vision/classification/resnet/model/resnet50-v1-12.onnx
- attention : export OMP_NUM_THREADS=1

**Expected behavior**
The performace of onednn version is much better than common version

