**Additional context**

Is there something wrong with my calling code or something wrong with my compiled library?
The command to compile the library is "./build.sh --use_dnnl --config Release --build_shared_lib --parallel 32"


It seems that the libonnxruntime.so.1.11.1 does not link to dnnl library. 
